import React, { useState } from 'react';
import './styles.scss';
const LoginPage = () => {
  const [email, setEmail] = useState('hello@reallygreatsite.com');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Login submitted', { email, password });
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-600">
      <div className="bg-gray-400 rounded-3xl p-12 w-full max-w-md shadow-2xl">
        <div className="text-center mb-8">
          <div className="flex items-center justify-center mb-2">
            <span className="text-6xl font-bold text-yellow-600">j</span>
            <span className="text-5xl font-bold text-white ml-1">ODDB</span>
            <span className="text-yellow-600 text-2xl ml-1">®</span>
          </div>
          <div className="text-white text-xs mb-1" style={{ direction: 'rtl' }}>
            المركز الأردني للتصميم والتطوير
          </div>
          <div className="text-white text-xs tracking-wider">
            JORDAN DESIGN & DEVELOPMENT BUREAU
          </div>
        </div>
        <h1 className="text-white text-5xl font-light text-center mb-2">Login</h1>
        <p className="text-white text-center mb-8 text-sm">Sign in to continue</p>
        <div className="space-y-6">
          <div>
            <label htmlFor="email" className="block text-white text-xs font-semibold mb-2 tracking-wider">
              EMAIL
            </label>
            <input
              type="email"
              id="email"
              className="w-full px-4 py-3 rounded bg-white text-gray-800 focus:outline-none focus:ring-2 focus:ring-yellow-600"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>

          <div>
            <label htmlFor="password" className="block text-white text-xs font-semibold mb-2 tracking-wider">
              PASSWORD
            </label>
            <input
              type="password"
              id="password"
              className="w-full px-4 py-3 rounded bg-white text-gray-800 focus:outline-none focus:ring-2 focus:ring-yellow-600"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="******"
            />
          </div>

          <button
            onClick={handleSubmit}
            className="w-full bg-yellow-600 hover:bg-yellow-700 text-white font-semibold py-3 rounded transition-colors duration-200"
          >
            login
          </button>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
